(4, 4, '2025-10-27 21:14:00', 'REFORMA DA LAGOA', 'Suspens√£o de atividades na lagoa a partir de 05/11/2025\\r\\n\\r\\nA Associa√ß√£o dos Moradores e Propriet√°rios do Empreendimento Serra da Liberdade comunica a suspens√£o tempor√°ria de pesca e atividades recreativas na lagoa para respeitar o per√≠odo de piracema e iniciar o Projeto de Revitaliza√ß√£o da Lagoa 2026.\\r\\n\\r\\nüîß Principais melhorias previstas:\\r\\n\\r\\n* Cercamento das laterais para prote√ß√£o ambiental\\r\\n* Instala√ß√£o de bancos, mesas, ilumina√ß√£o e pontos de energia\\r\\n* Wi-Fi comunit√°rio e √°rea de churrasco exclusiva para associados\\r\\n* Replantio de √°rvores nativas e soltura de alevinos\\r\\n* Paisagismo com novas esp√©cies ornamentais\\r\\n* Cria√ß√£o do \\\"Playground Kids\\\" com brinquedos ecol√≥gicos\\r\\n‚ö†Ô∏è Durante as obras:\\r\\n* √â proibido remover cercas ou acessar √°reas isoladas\\r\\n* Respeitar sinaliza√ß√µes e avisos de interdi√ß√£o\\r\\n\\r\\nüìû Contato:\\r\\n* Telefone: (31) 97228-8170\\r\\n* E-mail: serradaliberdade@outlook.com\\r\\n* Site: asserradaliberdade.ong.br', 'infomes lagoa.pdf', 'uploads/notificacoes/1761610534_69000b269030e.pdf', 'application/pdf', 1, NULL, '2025-10-28 00:15:34', '2025-10-28 00:15:34');
