--
-- Acionadores `logs_validacoes_dispositivo`
--
DELIMITER $$
CREATE TRIGGER `after_validacao_dispositivo_insert` AFTER INSERT ON `logs_validacoes_dispositivo` FOR EACH ROW BEGIN
    UPDATE dispositivos_tablets 
    SET 
        ultimo_acesso = NEW.validado_em,
        total_validacoes = total_validacoes + 1
    WHERE id = NEW.dispositivo_id;
END
$$
DELIMITER ;

