--
-- Acionadores `produtos_estoque`
--
DELIMITER $$
CREATE TRIGGER `trg_alerta_estoque_baixo` AFTER UPDATE ON `produtos_estoque` FOR EACH ROW BEGIN
    IF NEW.quantidade_estoque <= NEW.estoque_minimo AND NEW.ativo = 1 THEN
        VALUES (
            NEW.id,
            IF(NEW.quantidade_estoque = 0, 'Estoque_Zerado', 'Estoque_Minimo'),
            CONCAT(NEW.nome, ' est√° ', IF(NEW.quantidade_estoque = 0, 'ZERADO', 'abaixo do estoque m√≠nimo'), ': ', NEW.quantidade_estoque, ' ', NEW.unidade_medida, ' (m√≠nimo: ', NEW.estoque_minimo, ' ', NEW.unidade_medida, ')')
        );
    END IF;
END
$$
DELIMITER ;

