--
-- Estrutura para view `view_dispositivos_ativos`
--
DROP TABLE IF EXISTS `view_dispositivos_ativos`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_dispositivos_ativos`  AS SELECT `d`.`id` AS `id`, `d`.`nome` AS `nome`, `d`.`token` AS `token`, `d`.`local` AS `local`, `d`.`status` AS `status`, `d`.`ultimo_acesso` AS `ultimo_acesso`, `d`.`total_validacoes` AS `total_validacoes`, `d`.`criado_em` AS `criado_em`, timestampdiff(MINUTE,`d`.`ultimo_acesso`,now()) AS `minutos_desde_ultimo_uso`, count(`l`.`id`) AS `validacoes_hoje` FROM (`dispositivos_tablets` `d` left join `logs_validacoes_dispositivo` `l` on(((`d`.`id` = `l`.`dispositivo_id`) and (cast(`l`.`validado_em` as date) = curdate())))) WHERE (`d`.`status` = 'ativo') GROUP BY `d`.`id` ORDER BY `d`.`ultimo_acesso` DESC ;

-- --------------------------------------------------------

--
-- Estrutura para view `view_estatisticas_dispositivos`
--
DROP TABLE IF EXISTS `view_estatisticas_dispositivos`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_estatisticas_dispositivos`  AS SELECT count(0) AS `total_dispositivos`, sum((case when (`dispositivos_tablets`.`status` = 'ativo') then 1 else 0 end)) AS `dispositivos_ativos`, sum((case when (`dispositivos_tablets`.`status` = 'inativo') then 1 else 0 end)) AS `dispositivos_inativos`, sum(`dispositivos_tablets`.`total_validacoes`) AS `total_validacoes_geral`, (select count(0) from `logs_validacoes_dispositivo` where (cast(`logs_validacoes_dispositivo`.`validado_em` as date) = curdate())) AS `validacoes_hoje`, (select count(0) from `logs_validacoes_dispositivo` where ((`logs_validacoes_dispositivo`.`resultado` = 'sucesso') and (cast(`logs_validacoes_dispositivo`.`validado_em` as date) = curdate()))) AS `validacoes_sucesso_hoje`, (select count(0) from `logs_validacoes_dispositivo` where ((`logs_validacoes_dispositivo`.`resultado` = 'falha') and (cast(`logs_validacoes_dispositivo`.`validado_em` as date) = curdate()))) AS `validacoes_falha_hoje` FROM `dispositivos_tablets` ;

-- --------------------------------------------------------

--
-- Estrutura para view `view_estatisticas_tokens`
--
DROP TABLE IF EXISTS `view_estatisticas_tokens`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_estatisticas_tokens`  AS SELECT count(0) AS `total_tokens`, sum((case when ((`qrcode_tokens`.`usado` = 0) and (`qrcode_tokens`.`expira_em` > now())) then 1 else 0 end)) AS `tokens_ativos`, sum((case when (`qrcode_tokens`.`usado` = 1) then 1 else 0 end)) AS `tokens_usados`, sum((case when ((`qrcode_tokens`.`usado` = 0) and (`qrcode_tokens`.`expira_em` < now())) then 1 else 0 end)) AS `tokens_expirados`, sum((case when ((`qrcode_tokens`.`usado` = 1) and (cast(`qrcode_tokens`.`usado_em` as date) = curdate())) then 1 else 0 end)) AS `tokens_usados_hoje`, sum((case when ((`qrcode_tokens`.`usado` = 1) and (week(`qrcode_tokens`.`usado_em`,0) = week(now(),0))) then 1 else 0 end)) AS `tokens_usados_semana`, sum((case when ((`qrcode_tokens`.`usado` = 1) and (month(`qrcode_tokens`.`usado_em`) = month(now()))) then 1 else 0 end)) AS `tokens_usados_mes` FROM `qrcode_tokens` ;

-- --------------------------------------------------------

--
-- Estrutura para view `view_tokens_ativos`
--
DROP TABLE IF EXISTS `view_tokens_ativos`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_tokens_ativos`  AS SELECT `t`.`id` AS `id`, `t`.`token` AS `token`, `t`.`acesso_id` AS `acesso_id`, `t`.`expira_em` AS `expira_em`, `t`.`criado_em` AS `criado_em`, `a`.`qr_code` AS `qr_code`, `a`.`tipo_acesso` AS `tipo_acesso`, `a`.`data_inicial` AS `data_inicial`, `a`.`data_final` AS `data_final`, `v`.`nome_completo` AS `visitante_nome`, `v`.`documento` AS `visitante_documento`, timestampdiff(HOUR,now(),`t`.`expira_em`) AS `horas_restantes` FROM ((`qrcode_tokens` `t` join `acessos_visitantes` `a` on((`t`.`acesso_id` = `a`.`id`))) join `visitantes` `v` on((`a`.`visitante_id` = `v`.`id`))) WHERE ((`t`.`usado` = 0) AND (`t`.`expira_em` > now()) AND (curdate() between `a`.`data_inicial` and `a`.`data_final`)) ORDER BY `t`.`expira_em` ASC ;

